'use strict';

let error;
function lazyError() {
  if (!error) {
    error = require('internal/errors').codes.ERR_INTERNAL_ASSERTION;
  }
  return error;
}

function assert(value, message) {
  if (!value) {
    const ERR_INTERNAL_ASSERTION = lazyError();
    throw new ERR_INTERNAL_ASSERTION(message);
  }
}

function fail(message) {
  const ERR_INTERNAL_ASSERTION = lazyError();
  throw new ERR_INTERNAL_ASSERTION(message);
}

assert.fail = fail;

module.exports = assert;

'use strict';

const { RegExpPrototypeExec } = primordials;

const {
  prepareMainThreadExecution,
  markBootstrapComplete,
} = require('internal/process/pre_execution');

prepareMainThreadExecution(true);

markBootstrapComplete();

// Necessary to reset RegExp statics before user code runs.
RegExpPrototypeExec(/^/, '');

// Note: this loads the module through the ESM loader if the module is
// determined to be an ES module. This hangs from the CJS module loader
// because we currently allow monkey-patching of the module loaders
// in the preloaded scripts through require('module').
// runMain here might be monkey-patched by users in --require.
// XXX: the monkey-patchability here should probably be deprecated.
require('internal/modules/cjs/loader').Module.runMain(process.argv[1]);

const cluster = require('cluster')

cluster.on('fork', () => {
  throw new Error('0x does not support clustering.')
})

'use strict'
const net = require('net')

let isWorker = false
try {
  // Skip redirecting stdout in Worker threads.
  isWorker = !require('worker_threads').isMainThread
} catch (e) {}

if (!isWorker) {
  const socket = new net.Socket({
    fd: 3,
    readable: false,
    writable: true
  })
  Object.defineProperty(process, 'stdout', {
    configurable: true,
    enumerable: true,
    get: () => socket
  })
  Object.defineProperty(process.stdout, 'fd', {
    value: socket._handle.fd
  })
}

'use strict';

const {
  isMainThread,
  SHARE_ENV,
  resourceLimits,
  setEnvironmentData,
  getEnvironmentData,
  threadId,
  Worker,
} = require('internal/worker');

const {
  MessagePort,
  MessageChannel,
  moveMessagePortToContext,
  receiveMessageOnPort,
  BroadcastChannel,
} = require('internal/worker/io');

const {
  markAsUntransferable,
} = require('internal/buffer');

module.exports = {
  isMainThread,
  MessagePort,
  MessageChannel,
  markAsUntransferable,
  moveMessagePortToContext,
  receiveMessageOnPort,
  resourceLimits,
  threadId,
  SHARE_ENV,
  Worker,
  parentPort: null,
  workerData: null,
  BroadcastChannel,
  setEnvironmentData,
  getEnvironmentData,
};

'use strict';

const {
  RegExpPrototypeExec,
} = primordials;
const { getOptionValue } = require('internal/options');

const experimentalWasmModules = getOptionValue('--experimental-wasm-modules');

const extensionFormatMap = {
  '__proto__': null,
  '.cjs': 'commonjs',
  '.js': 'module',
  '.json': 'json',
  '.mjs': 'module',
};

if (experimentalWasmModules) {
  extensionFormatMap['.wasm'] = 'wasm';
}

/**
 * @param {string} mime
 * @returns {string | null}
 */
function mimeToFormat(mime) {
  if (
    RegExpPrototypeExec(
      /^\s*(text|application)\/javascript\s*(;\s*charset=utf-?8\s*)?$/i,
      mime,
    ) !== null
  ) return 'module';
  if (mime === 'application/json') return 'json';
  if (experimentalWasmModules && mime === 'application/wasm') return 'wasm';
  return null;
}

module.exports = {
  extensionFormatMap,
  mimeToFormat,
};

'use strict';

const { exitCodes: { kUnfinishedTopLevelAwait } } = internalBinding('errors');

// Handle a Promise from running code that potentially does Top-Level Await.
// In that case, it makes sense to set the exit code to a specific non-zero
// value if the main code never finishes running.
function handleProcessExit() {
  process.exitCode ??= kUnfinishedTopLevelAwait;
}

module.exports = {
  handleProcessExit,
};

import net from 'net';

const port = 8080; // Choose an available port
const dataSize = 3 * 1024 * 1024; // 3MB in bytes
const data = Buffer.alloc(dataSize, '0'); // Allocate a buffer for the data


const server = net.createServer((socket) => {
  socket.on('data', (data) => {
    console.log(`Received data: ${data.toString()}`);
  });

  socket.on('end', () => {
    console.log('Data transfer complete');
    socket.end();
    server.close(); // Close the server when data transfer is complete
  });
});

server.listen(port, () => {
  console.log(`Server listening on port ${port}`);
  const client = net.createConnection(port);
  client.write(data); // Send the data
  client.end();
});
